" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Longitudinal and transverse fractures of the phalanges",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 442px; height: 584px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) This oblique examination&nbsp;of the right index finger reveals two separate fractures. There is a longitudinal fracture of the distal phalanx that traverses the joint. A second comminuted fracture in the proximal phalanx consists of a longitudinal component that traverses the proximal interphalangeal joint and a horizontal component through the mid to distal shaft.",
"    <br>",
"     (B) The fractures are highlighted.",
