var title_f9_2_9257="Dipylidium caninum life cycle";
var content_f9_2_9257=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F53612&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F53612&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 630px\">",
"   <div class=\"ttl\">",
"    Dipylidium caninum life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 610px; height: 460px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Gravid proglottids are passed intact in the feces or emerge from the perianal region of the host",
"    <strong>",
"     (1)",
"    </strong>",
"    . Subsequently, they release typical egg packets",
"    <strong>",
"     (2)",
"    </strong>",
"    . On rare occasions, proglottids rupture and egg packets are seen in stool samples. Following ingestion of an egg by the intermediate host (larval stages of the dog or cat flea",
"    <em>",
"     Ctenocephalides",
"    </em>",
"    spp), an oncosphere is released into the flea's intestine. The oncosphere penetrates the intestinal wall, invades the insect's hemocoel (body cavity), and develops into a cysticercoid larva",
"    <strong>",
"     (3)",
"    </strong>",
"    . The larva develops into an adult, and the adult flea harbors the infective cysticercoid",
"    <strong>",
"     (4)",
"    </strong>",
"    . The vertebrate host becomes infected by ingesting the adult flea containing the cysticercoid",
"    <strong>",
"     (5)",
"    </strong>",
"    . The dog is the principal definitive host for",
"    <em>",
"     Dipylidium caninum",
"    </em>",
"    . Other potential hosts include cats, foxes, and humans (mostly children)",
"    <strong>",
"     (6,7)",
"    </strong>",
"    . Humans acquire infection by ingesting the cysticercoid contaminated flea. This can be promulgated by close contact between children and their infected pets. In the small intestine of the vertebrate host the cysticercoid develops into the adult tapeworm which reaches maturity about one month after infection",
"    <strong>",
"     (8)",
"    </strong>",
"    . The adult tapeworms (measuring up to 60 cm in length and 3 mm in width) reside in the small intestine of the host, where they each attach by their scolex. They produce proglottids (or segments) which have two genital pores (hence the name \"double-pored\" tapeworm). The proglottids mature, become gravid, detach from the tapeworm, and migrate to the anus or are passed in the stool",
"    <strong>",
"     (1)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Dipylidium caninum infection. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Dipylidium.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Dipylidium.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
